import logo from '../assets/images/logo.png'

const quick_links = [
  {
    path: "/home",
    display: "Home",
  },
  {
    path: "/about",
    display: "About",
  },
  {
    path: "/tours",
    display: "Tours",
  },
];




const Footer = () => {
  return (
    <footer className='footer'>
      <Container>
        <Row>
          <Col lg='12'>

          </Col>
        </Row>
      </Container>
    </footer>
  )
}

export default Footer
